import React from "react";

const Agree = ({state, onChange, changeFlow}) => {
    const handleChangeCheckbox1 = (e) => {
        onChange({agree1: e.target.checked})
    }

    const handleChangeCheckbox2 = (e) => {
        const isChecked = e.target.checked
        onChange({agree2: isChecked})
    }
    return <>
            <br />
        <label>
            Zgoda 1:
            <input type={"checkbox"} onChange={handleChangeCheckbox1} checked={state.data.agree1}/>
        </label>
            <br />
        <label>Zgoda 2:
            <input type={"checkbox"} onChange={handleChangeCheckbox2} checked={state.data.agree2}/>
        </label>
    </>
}

export default Agree
